import React from 'react'

import Form from './components/auth/form';
import { BrowserRouter } from 'react-router-dom';
//import { Router, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route exact path ="./components/auth/form"  element={<Form/>}/>
    </Routes>

    </BrowserRouter>

  );
}

export default App;
